import React from 'react';
import { StyleSheet, Text, View, TouchableOpacity, Image} from 'react-native';

 const Navbar = () => {
        return (
            <View style={styles.navbar}>
                <TouchableOpacity>
                    <Image
                        source={require('../../assets/img/anadir.svg')}
                        style={ styles.img }
                    />
                </TouchableOpacity>
                <TouchableOpacity>
                    <Image
                        source={require('../../assets/img/list.svg')}
                        style={ styles.img }                    
                    />
                </TouchableOpacity>
                <TouchableOpacity>
                    <Image
                        source={require('../../assets/img/trofeo.svg')}
                        style={ styles.img }                    
                    />
                </TouchableOpacity>
                <TouchableOpacity>
                    <Image
                        source={require('../../assets/img/color-palette.svg')}
                        style={ styles.img }                    
                    />
                </TouchableOpacity>
          
            </View>

        )




}
const styles = StyleSheet.create({

    navbar: {
        position: 'absolute',
        bottom: 0,
        flex: 1,
        flexDirection: "row",
        justifyContent: 'space-around',
        backgroundColor: '#1E73BE',
        alignItems: 'center',
        justifyContent: 'center',
        width: '100%'
      },
     img: {
        minWidth: 30,
        minHeight: 30,
        marginBottom: 10 
        // width: 50, 
        // height: 50, 
        // marginBottom: 15 
     }



})

export default Navbar
